<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>
        body{    
    background-repeat: no-repeat;
    background-size:cover;
    display: flex;
    height: 100vh;
    align-items: center;
    justify-content: center;
}
.container{
   width: 70vw;
   height: 75vh;
   border: 2px solid;
   border-radius: 30px;
   text-align: center;
    background-color:aquamarine;
    
}
.radio-1{
    width:50vw;
    height: 50vh;
    display: flex;
    align-items: center;
    gap: 5px;
    justify-content: center;
    position: relative;
    left: 20px;
}
img{ 
   width: 150px;
   height: 150px;
   justify-content: center;
   margin-bottom: 40px;
   border-radius: 50%;
}
.link1{
    width: 5vw;
    height: 2vh;
    background-color:black;
    border-radius: 10px;
}
.link2{
    width:1vw;
    height: 10vh;
    border-radius: 10px;
    background-color:chartreuse;
    animation: a 1s ease-in-out infinite alternate ;
}
@keyframes a{
    from{
        transform: translateY(0px);
    }
    to{
        transform: translateY(10px);
        height: 20px;
    }
}
.link3{
    width: 1vw;
    height: 8vh;
    border-radius: 10px;
    background-color:blue;
    animation: a 0.8s ease-in-out infinite alternate ;
}
@keyframes a{
    from{
        transform: translateY(40px);
    }
    to{
        transform: translateY(10px);
    }
}
.link4{
    width: 1vw;
    height: 15vh;
    border-radius: 10px;
    background-color:darkorange;
    animation: a 0.3s ease-in-out infinite alternate ;
}
@keyframes a{
    from{
        transform: translateY(5px);
    }
    to{
        transform: translateY(10px);
    }
}
.link5{
    width: 1vw;
    height: 5vh;
    border-radius: 10px;
    background-color:brown;
    animation: a 0.9s ease-in-out infinite alternate ;
}
@keyframes a{
    from{
        transform: translateY(-10px);
    }
    to{
        transform: translateY(10px);
    }
}
.link6{
    width: 1vw;
    height: 12vh;
    border-radius: 10px;
    background-color:darkmagenta;
    animation: a 0.6s ease-in-out infinite alternate ;
}
@keyframes a{
    from{
        transform: translateY(-10px);
    }
    to{
        transform: translateY(10px);
    }
}
.link7{
    width: 1vw;
    height:20vh;
    border-radius: 10px;
    background-color:bisque;
    animation: a 0.5s ease-in-out infinite alternate ;
}
@keyframes a{
    from{
        transform: translateY(-10px);
    }
    to{
        transform: translateY(10px);
    }
}
.link8{
    width: 1vw;
    height: 18vh;
    border-radius: 10px;
    background-color:blueviolet;
    animation: a 0.3s ease-in-out infinite alternate ;
}
@keyframes a{
    from{
        transform: translateY(-10px);
    }
    to{
        transform: translateY(10px);
    }
}
.link9{
    width: 1vw;
    height: 5vh;
    border-radius: 10px;
    background-color:burlywood;
    animation: a 0.2s ease-in-out infinite alternate ;
}
@keyframes a{
    from{
        transform: translateY(-10px);
    }
    to{
        transform: translateY(10px);
    }
}
.link10{
    width: 1vw;
    height: 10vh;
    border-radius: 10px;
    background-color:chocolate;
    animation: a 0.5s ease-in-out infinite alternate ;
}
@keyframes a{
    from{
        transform: translateY(-10px);
    }
    to{
        transform: translateY(10px);
    }
}
.link11{
    width: 5vw;
    height: 2vh;
    background-color:black;
   border-radius: 10px;
}
.audio{
   width: 80%;
}
@media screen and (min-width:360){
    .radio-1{
    width:50vw;
    height: 50vh;
    display: flex;
   
    gap: 5px;
    justify-content: center;
    position: relative;
    
}
img{ 
   width: 150px;
   height: 150px;
   justify-content: center;
   margin-bottom: 30px;
   
}

}
</style>
</head>
